// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract AirdropDistributor is Ownable, Pausable, ReentrancyGuard {
    IERC20 public immutable token;
    uint256 public constant MAX_BATCH_SIZE = 200;

    event Airdropped(address indexed recipient, uint256 amount);
    event BulkAirdrop(uint256 totalRecipients, uint256 totalAmount);
    event TokensRecovered(address token, uint256 amount);

    constructor(IERC20 _token) {
        require(address(_token) != address(0), "Invalid token address");
        token = _token;
    }

    function airdrop(
        address[] calldata recipients,
        uint256[] calldata amounts
    ) external onlyOwner whenNotPaused nonReentrant {
        require(recipients.length > 0, "No recipients");
        require(recipients.length <= MAX_BATCH_SIZE, "Batch too large");
        require(recipients.length == amounts.length, "Array length mismatch");

        uint256 totalAmount;
        for (uint256 i = 0; i < recipients.length; i++) {
            require(recipients[i] != address(0), "Invalid recipient");
            require(amounts[i] > 0, "Invalid amount");
            totalAmount += amounts[i];
        }

        require(token.balanceOf(address(this)) >= totalAmount, "Insufficient balance");

        for (uint256 i = 0; i < recipients.length; i++) {
            require(token.transfer(recipients[i], amounts[i]), "Transfer failed");
            emit Airdropped(recipients[i], amounts[i]);
        }

        emit BulkAirdrop(recipients.length, totalAmount);
    }

    function recoverTokens(address _token, uint256 amount) external onlyOwner {
        require(_token != address(token) || paused(), "Cannot recover main token while active");
        IERC20(_token).transfer(owner(), amount);
        emit TokensRecovered(_token, amount);
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}

contracts/BuyBack.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

contract Buyback is Ownable {
    IUniswapV2Router02 public immutable router;
    address public immutable WETH;
    address public immutable imaliToken;

    address public treasury;
    address public burnAddress;
    uint256 public treasuryShare = 60;
    uint256 public slippageTolerance = 5; // 5%

    event BuybackExecuted(uint256 maticUsed, uint256 imaliBought, uint256 burned);
    event ConfigUpdated(address treasury, address burnAddress, uint256 treasuryShare, uint256 slippage);

    constructor(
        address _router,
        address _imaliToken,
        address _treasury,
        address _burnAddress
    ) {
        require(_router != address(0), "Invalid router");
        require(_imaliToken != address(0), "Invalid token");
        router = IUniswapV2Router02(_router);
        WETH = router.WETH();
        imaliToken = _imaliToken;
        treasury = _treasury;
        burnAddress = _burnAddress;
    }

    receive() external payable {}

    function executeBuyback() external onlyOwner {
        uint256 maticBalance = address(this).balance;
        require(maticBalance > 0, "No MATIC balance");

        uint256 treasuryAmount = (maticBalance * treasuryShare) / 100;
        uint256 burnAmount = maticBalance - treasuryAmount;

        if (treasuryAmount > 0) {
            (bool sent, ) = treasury.call{value: treasuryAmount}("");
            require(sent, "Treasury transfer failed");
        }

        _swapAndBurn(burnAmount);
    }

    function _swapAndBurn(uint256 amount) private {
        address[] memory path = new address[](2);
        path[0] = WETH;
        path[1] = imaliToken;

        uint256 initialBalance = IERC20(imaliToken).balanceOf(burnAddress);

        router.swapExactETHForTokensSupportingFeeOnTransferTokens{
            value: amount
        }(
            0, // minimum amount out
            path,
            burnAddress,
            block.timestamp + 300
        );

        uint256 newBalance = IERC20(imaliToken).balanceOf(burnAddress);
        emit BuybackExecuted(amount, newBalance - initialBalance, newBalance - initialBalance);
    }

    function updateBuybackConfig(
        address _treasury,
        address _burnAddress,
        uint256 _treasuryShare
    ) external onlyOwner {
        require(_treasuryShare <= 100, "Invalid share");
        treasury = _treasury;
        burnAddress = _burnAddress;
        treasuryShare = _treasuryShare;
        emit ConfigUpdated(_treasury, _burnAddress, _treasuryShare, slippageTolerance);
    }

    function emergencyWithdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

contracts/LiquidityManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";

contract LiquidityManager is Ownable, Pausable {
    IERC20 public immutable token;
    IUniswapV2Router02 public immutable router;
    IUniswapV2Factory public immutable factory;

    address public lpTokenReceiver;
    uint256 public minLiquidityAmount = 1 ether;
    uint256 public slippageTolerance = 2; // 2%

    event LiquidityAdded(uint256 tokenAmount, uint256 ethAmount, uint256 liquidity);
    event LiquidityRemoved(uint256 liquidity, uint256 tokenAmount, uint256 ethAmount);
    event ConfigUpdated(address lpTokenReceiver, uint256 slippage, uint256 minAmount);

    constructor(
        IERC20 _token,
        IUniswapV2Router02 _router,
        address _lpTokenReceiver
    ) {
        require(address(_token) != address(0), "Invalid token");
        require(address(_router) != address(0), "Invalid router");
        token = _token;
        router = _router;
        factory = IUniswapV2Factory(_router.factory());
        lpTokenReceiver = _lpTokenReceiver;
    }

    function addLiquidity(
        uint256 tokenAmount,
        uint256 ethAmount,
        uint256 minTokenAmount,
        uint256 minEthAmount,
        uint256 deadline
    ) external payable onlyOwner whenNotPaused {
        require(msg.value == ethAmount, "ETH amount mismatch");
        require(tokenAmount >= minLiquidityAmount, "Below minimum");
        require(ethAmount >= minLiquidityAmount, "Below minimum");
        require(deadline >= block.timestamp, "Deadline passed");

        uint256 tokenAllowance = token.allowance(address(this), address(router));
        if (tokenAllowance < tokenAmount) {
            require(token.approve(address(router), type(uint256).max), "Approval failed");
        }

        (uint256 usedToken, uint256 usedEth, uint256 liquidity) = router.addLiquidityETH{value: ethAmount}(
            address(token),
            tokenAmount,
            minTokenAmount,
            minEthAmount,
            lpTokenReceiver,
            deadline
        );

        // Return unused ETH
        if (msg.value > usedEth) {
            payable(owner()).transfer(msg.value - usedEth);
        }

        emit LiquidityAdded(usedToken, usedEth, liquidity);
    }

    function removeLiquidity(
        address lpToken,
        uint256 liquidity,
        uint256 minTokenAmount,
        uint256 minEthAmount,
        uint256 deadline
    ) external onlyOwner {
        require(liquidity > 0, "No liquidity");
        require(deadline >= block.timestamp, "Deadline passed");

        IERC20(lpToken).approve(address(router), liquidity);

        (uint256 amountToken, uint256 amountETH) = router.removeLiquidityETH(
            address(token),
            liquidity,
            minTokenAmount,
            minEthAmount,
            owner(),
            deadline
        );

        emit LiquidityRemoved(liquidity, amountToken, amountETH);
    }

    function updateConfig(
        address _lpTokenReceiver,
        uint256 _slippage,
        uint256 _minLiquidityAmount
    ) external onlyOwner {
        require(_slippage <= 10, "Slippage too high");
        lpTokenReceiver = _lpTokenReceiver;
        slippageTolerance = _slippage;
        minLiquidityAmount = _minLiquidityAmount;
        emit ConfigUpdated(_lpTokenReceiver, _slippage, _minLiquidityAmount);
    }

    function emergencyWithdraw(address _token, uint256 amount) external onlyOwner {
        if (_token == address(0)) {
            payable(owner()).transfer(address(this).balance);
        } else {
            IERC20(_token).transfer(owner(), amount);
        }
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    receive() external payable {}
}

