// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract VestingVault is Ownable, ReentrancyGuard {
    IERC20 public immutable token;

    struct VestingSchedule {
        uint256 totalAmount;
        uint256 released;
        uint256 startTime;
        uint256 cliffDuration;
        uint256 vestingDuration;
        bool revocable;
    }

    mapping(address => VestingSchedule) public vestingSchedules;
    mapping(address => bool) public revokedVestings;

    event VestingCreated(address beneficiary, uint256 amount, uint256 startTime);
    event TokensReleased(address beneficiary, uint256 amount);
    event VestingRevoked(address beneficiary, uint256 unreleasedAmount);

    constructor(IERC20 _token) {
        require(address(_token) != address(0), "Invalid token");
        token = _token;
    }

    function createVestingSchedule(
        address beneficiary,
        uint256 amount,
        uint256 startTime,
        uint256 cliffDuration,
        uint256 vestingDuration,
        bool revocable
    ) external onlyOwner {
        require(beneficiary != address(0), "Invalid beneficiary");
        require(amount > 0, "Amount must be > 0");
        require(vestingSchedules[beneficiary].totalAmount == 0, "Beneficiary already has vesting");
        require(vestingDuration > 0, "Duration must be > 0");
        require(cliffDuration <= vestingDuration, "Cliff exceeds duration");

        vestingSchedules[beneficiary] = VestingSchedule(
            amount,
            0,
            startTime,
            cliffDuration,
            vestingDuration,
            revocable
        );

        require(token.transferFrom(msg.sender, address(this), amount), "Transfer failed");
        emit VestingCreated(beneficiary, amount, startTime);
    }

    function release() external nonReentrant {
        VestingSchedule storage schedule = vestingSchedules[msg.sender];
        require(schedule.totalAmount > 0, "No vesting schedule");
        require(!revokedVestings[msg.sender], "Vesting revoked");

        uint256 releasable = vestedAmount(msg.sender) - schedule.released;
        require(releasable > 0, "No tokens to release");

        schedule.released += releasable;
        require(token.transfer(msg.sender, releasable), "Transfer failed");
        emit TokensReleased(msg.sender, releasable);
    }

    function revokeVesting(address beneficiary) external onlyOwner {
        VestingSchedule memory schedule = vestingSchedules[beneficiary];
        require(schedule.revocable, "Vesting not revocable");
        require(!revokedVestings[beneficiary], "Already revoked");

        uint256 vested = vestedAmount(beneficiary);
        uint256 unreleased = vested - schedule.released;
        uint256 revokedAmount = schedule.totalAmount - vested;

        revokedVestings[beneficiary] = true;

        if (unreleased > 0) {
            require(token.transfer(beneficiary, unreleased), "Transfer failed");
        }

        if (revokedAmount > 0) {
            require(token.transfer(owner(), revokedAmount), "Transfer failed");
        }

        emit VestingRevoked(beneficiary, revokedAmount);
    }

    function vestedAmount(address beneficiary) public view returns (uint256) {
        VestingSchedule memory schedule = vestingSchedules[beneficiary];
        if (schedule.totalAmount == 0) return 0;
        if (block.timestamp < schedule.startTime + schedule.cliffDuration) return 0;
        if (block.timestamp >= schedule.startTime + schedule.vestingDuration) return schedule.totalAmount;

        return (schedule.totalAmount * (block.timestamp - schedule.startTime)) / schedule.vestingDuration;
    }

    function recoverExcessTokens(uint256 amount) external onlyOwner {
        uint256 contractBalance = token.balanceOf(address(this));
        uint256 lockedAmount = _totalLockedAmount();
        require(contractBalance > lockedAmount, "No excess tokens");
        uint256 excess = contractBalance - lockedAmount;
        require(amount <= excess, "Amount exceeds excess");
        require(token.transfer(owner(), amount), "Transfer failed");
    }

    function _totalLockedAmount() private view returns (uint256) {
        // In a production environment, you might need to track this differently
        // This simple implementation assumes all vesting schedules are active
        return token.balanceOf(address(this));
    }
}

